import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({ className }) => {
    return (
        <div className={className}>
            <img src='https://samples.clarifai.com/face-det.jpg' alt=''></img>
        </div>
    );
}

export default FaceRecognition;
